// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ERC721Connector.sol";

contract KryptoBird is ERC721Connector {
  // array to store our nfts
  string[] public kryptoBirdz;
 
  mapping(string => bool) _kryptoBirdzExists;

  function mint(string memory _kryptoBird) public {
    require(_kryptoBirdzExists[_kryptoBird] == false, "KryptoBird: kryptoBird already exists");

    // this is deprecated - uint _id = KryptoBirdz.push(_kryptoBird);
    // .push no longer retruns the length but a ref to added element

    kryptoBirdz.push(_kryptoBird);
    uint256 _id = kryptoBirdz.length - 1;
    _mint(msg.sender, _id);

    _kryptoBirdzExists[_kryptoBird] = true;
  }

  constructor() ERC721Connector('Kryptobird', 'KRB') {

  }
}
